import './App.css';


function mousel(){
  b=''
  if (MouseEvent == True) {
    b=<d1>oui</d1>
  } else {
    b=<d2> non </d2>
  }
  return(b);
}
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          <code>Bienvenue</code>
        </p>
        <mousel></mousel>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
